const colorPrimary = '#BE1E2D';
const colorSecondary = '#ffffff';
const colorTertiary = '#e7e5e6';
const colorPrimaryTypo = '#434343';
const colorSecondaryTypo = '#4285F4';

export { colorPrimary, colorSecondary, colorTertiary, colorPrimaryTypo, colorSecondaryTypo };
